ly too, when d is lengthened, t will increase accordingly. \n\nThis rationale confirms the distortion of time over movements of time frames relative to each other.  However, the distortion is not only confined to dilation but should also include  expansion. \n\nAs the doppler effect exists in sound surroundings, it is suggested, time distortions  do occur at such regular circumstances. \n\nThe distortion of time is not too significant to cause much bother on earthy existence. Its significant over space and accountable when we need to compute consequences of space travel, time frames between planets, between star systems, galaxies etc.",
